import React from "react";
import Header from "../components/header";
import styles from "./login.module.css";

function Main() {
  return (
    <>
      <Header />
      <div className={styles.loginSection}>
        여긴 로그인 영역이네?
        <div id="email"
          type="email"
          value={email}
          placeholder="이메일"
          required>
        </div>
      </div>
    </>
  );
}
export default Main;
